import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input and type a partial query
    const searchInput = await page.waitForSelector('#searchInput', { timeout: 5000 });
    await searchInput.fill('iPhone');

    // Wait for the autocomplete suggestions to appear
    await page.waitForSelector('#searchSuggestions', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions_visible.png'));

    // Get the text of the first suggestion and click it
    const firstSuggestion = page.locator('.suggestion-item').first();
    const suggestionText = await firstSuggestion.textContent();
    await firstSuggestion.click();

    // Wait for the suggestions to disappear after clicking
    await page.waitForSelector('#searchSuggestions', { state: 'hidden', timeout: 5000 });

    // Take a final screenshot to show the input has been updated
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestion_selected.png'));

    // Extract the final value from the search input to verify
    const finalInputValue = await page.inputValue('#searchInput');

    return {
      success: true,
      action: "Tested search autocomplete by typing, waiting for suggestions, and selecting an option.",
      extractedData: {
        selectedSuggestion: suggestionText.trim(),
        finalInputValue: finalInputValue.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
